	//Helper JSON methods
	//Create json string and object based on weather data
	function createJSONString(weather){
		var weatherData = '{"temperature":"' +weather.temperature() + '","feelsLike":"'+weather.feelsLike()
		+'","humidity":"'+weather.humidity() + '","sunset":"'+weather.sunset()
		+'","sunrise":"'+weather.sunrise() + '","pressure":"'+weather.pressure()
		+'","visibility":"'+weather.visibility() + '","windDirection":"'+weather.windDirection()
		+'","windSpeed":"'+weather.windSpeed() + '"}';
		return weatherData;
	}
	function createJSONObj(weatherData){
		var weatherJSON = JSON.parse(weatherData);
		return weatherJSON;
	}
	//Globals
	var write = false;
	var textFile = "test.json";

