	//File Read Functions
	function readFromFile(){
	    console.log("reading from file");
		write = false;
		textFile = "test.json";
		getFileSystem();
	}
	function gotFile(file){
		readAsText(file);
	}
	//Read as text and update data
	function readAsText(file){
		var reader = new FileReader();
		reader.onloadend = function(evt){
			console.log("Read as text");
			console.log(evt.target.result);

			weatherData = getJSONWeatherDataAsObj(evt.target.result);

			if(weatherData){
				console.log("weather updating now...");
				weather.viewModel.temperature(weatherData["temperature"]);
				weather.viewModel.feelsLike(weatherData["feelsLike"]);
				weather.viewModel.humidity(weatherData["humidity"]);
				weather.viewModel.sunrise(weatherData["sunrise"]);
				weather.viewModel.sunset(weatherData["sunset"]);
				weather.viewModel.visibility(weatherData["visibility"]);
				weather.viewModel.pressure(weatherData["pressure"]);
				weather.viewModel.windSpeed(weatherData["windSpeed"]);
				weather.viewModel.windDirection(weatherData["windDirection"]);
			}
		};
		reader.readAsText(file);
	}

	//Convert JSON string to JSON obj
	function getJSONWeatherDataAsObj(result){
		var weatherData;
		if(result !== undefined){
			weatherData = createJSONObj(result);
			//alert("Temperature is: "+weatherData["temperature"]);
			return weatherData;
		}
	}

